('05bec407-cf32-4f37-a80b-bc2d9dcb8013', '2c5c8e58-9a82-42ad-bf67-db85c60e2feb', 'Pagi Manis', 'public/daycare/1737449729_pagi manis.jpeg', 'Paramita Daycare is a trusted childcare facility located at Jl. Bukit Bougenvile Raya, Sendangmulyo, Tembalang District, Semarang City, Central Java 50272. Designed to provide a nurturing and stimulating environment, the daycare offers a comprehensive program that combines educational activities, creative play, and social-emotional learning to support children’s growth and development. With a team of experienced and caring professionals, Paramita Daycare ensures the safety, well-being, and happiness of every child in its care. The facility features well-equipped classrooms, a safe outdoor play area, and age-appropriate learning materials to foster curiosity and exploration. Conveniently situated in the heart of Tembalang, it provides parents peace of mind knowing their children are in a secure, enriching environment that emphasizes personalized care and open communication.', '08:00:00', '17:00:00', 'Senin - Jumat', '08132749872', 5.0, 1, 'Kota Semarang', 110.443209283950610, -7.059071138319458, 'Jl. Bukit Bougenvile Raya, Sendangmulyo, Tembalang District, Semarang City, Central Java 50272', '1km dari Universitas Diponegoro', 0, 'BRI', '12345678', 'Pagi Manis', '2025-01-21 01:55:29', '2025-01-21 10:26:22'),
